g5.pageJump = function (pageNumber) {
    if (pageNumber<1) pageNumber = 1;
    if (pageNumber>g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent!=pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent>0) {
            query();
            search();
        }
    }
}

g5.refreshDetail = function(index) {
    ee.setText(ee.getControl("layoutxitem23"), ee.getText(ee.getControl("tablebody1").cols[0].rows[index]));
    ee.setEditText(ee.getControl("edit3"), ee.getText(ee.getControl("tablebody1").cols[1].rows[index]));
    ee.setEditText(ee.getControl("edit23"), ee.getText(ee.getControl("tablebody1").cols[2].rows[index]));
    ee.setEditText(ee.getControl("edit4"), ee.getText(ee.getControl("tablebody1").cols[3].rows[index]));
    ee.setEditText(ee.getControl("edit5"), ee.getText(ee.getControl("tablebody1").cols[4].rows[index]));
    ee.setEditText(ee.getControl("edit8"), ee.getText(ee.getControl("tablebody1").cols[5].rows[index]));
    ee.setEditText(ee.getControl("edit6"), ee.getText(ee.getControl("tablebody1").cols[6].rows[index]));
    ee.setEditText(ee.getControl("edit16"), ee.getText(ee.getControl("tablebody1").cols[7].rows[index]));
    ee.setEditText(ee.getControl("edit2"), ee.getText(ee.getControl("tablebody1").cols[8].rows[index]));             
    //订单状态
    var status;
    var getstatus=ee.getText(ee.getControl("tablebody1").cols[9].rows[index]);
    if(getstatus=='待分配'){
        status=0;
    }else if(getstatus=='已分配'){
        status=1;
    }else if(getstatus=='进行中'){
        status=2;
    }else if(getstatus=='已完成'){
        status=3;
    }else if(getstatus=='已取消'){
        status=4;
    }else if(getstatus=='无驾照'){
        status=5;
    }
    ee.setEditText(ee.getControl("edit10"), status); 
    //供车   
    var provide;
    var getprovide=ee.getText(ee.getControl("tablebody1").cols[10].rows[index]);
    if(getprovide=='教练供车'){  
        provide=0;
    }else if(getprovide=='学员供车'){ 
        provide=1;
    }
    ee.setEditText(ee.getControl("edit22"), provide);    
    //汽车档位
    var type;
    var gettype=ee.getText(ee.getControl("tablebody1").cols[11].rows[index]);
    if(gettype=='手动挡'){   
        type=0;
    }else if(gettype=='自动挡'){  
        type=1;
    }
    ee.setEditText(ee.getControl("edit9"), type);  

    ee.setEditText(ee.getControl("edit24"), ee.getText(ee.getControl("tablebody1").cols[12].rows[index]));
    ee.setEditText(ee.getControl("edit19"), ee.getText(ee.getControl("tablebody1").cols[13].rows[index]));
    ee.setEditText(ee.getControl("edit11"), ee.getText(ee.getControl("tablebody1").cols[14].rows[index]));
    ee.setEditText(ee.getControl("edit7"), ee.getText(ee.getControl("tablebody1").cols[15].rows[index]));
    ee.setEditText(ee.getControl("edit26"), ee.getText(ee.getControl("tablebody1").cols[16].rows[index]));
    //已付款
    var Received;
    var getReceived=ee.getText(ee.getControl("tablebody1").cols[17].rows[index]);
    if(getReceived=='未收款'){   
        Received=0;
    }else if(getReceived=='已收款'){  
        Received=1;
    }
    ee.setEditText(ee.getControl("edit27"), Received);

    //var s = ee.getText(ee.getControl("tablebody1").cols[3].rows[index]).split("-");
   // ee.setEditText(ee.getControl("edit6"), s[0]);
   // ee.setEditText(ee.getControl("edit7"), s[1]);
    //ee.setEditText(ee.getControl("edit8"), ee.getText(ee.getControl("tablebody1").cols[5].rows[index]));
}

