taskSetItem.script3:
dataset1 = eio.readDataSet(); 
d = "<tr>";
d += "<td>序号</td>";
d += "<td>城市</td>";
d += "<td>预约开始时间</td>";
d += "<td>课时数（小时）</td>";
d += "<td>陪练地址</td>";
d += "<td>学员备注</td>";
d += "<td>学员姓名</td>";
d += "<td>学员手机号</td>";
d += "<td>陪练员姓名</td>";
d += "<td>陪练员手机号</td>";
d += "<td>供车</td>";
d += "<td>汽车档位</td>";
d += "<td>订单状态</td>";
d += "<td>费用</td>";
d += "<td>收款</td>";
d += "<td>备注</td>";
d += "<td>订单创建时间</td>";
d += "<td>订单修改时间</td>";
d += "</tr>"; 
for (var y = 0; y < dataset1.rowCount; y++) {
    d += "<tr>";
    for (var x = 0; x < dataset1.colCount; x++) {   
         if(x == 12){   
//           0-待分配 1-已分配 2-进行中 3-已完成 4-已取消 5-无驾照
            if(dataset1.getData(x,y) == 0){
                d += "<td>待分配</td>";
            }else if(dataset1.getData(x,y) == 1) { 
                d += "<td>已分配</td>";
            }else if (dataset1.getData(x,y) == 2){
                d += "<td>进行中</td>";
            }else if (dataset1.getData(x,y) == 3){
                d += "<td>已完成</td>";
            }else if (dataset1.getData(x,y) == 4){
                d += "<td>已取消</td>";
            }else if (dataset1.getData(x,y) == 5){
                d += "<td>无驾照</td>";
            }else {
                d += "<td>异常</td>";
            }
        }else if(x == 10){  
//          0-教练供车 1-学员供车 
            if(dataset1.getData(x,y) == 0){
                d += "<td>教练供车</td>";
            }else if(dataset1.getData(x,y) == 1) { 
                d += "<td>学员供车</td>";
            }else {
                d += "<td></td>";
            }
        }else if(x == 11){  
//          0-手动挡   1-自动挡
            if(dataset1.getData(x,y) == 0){
                d += "<td>手动挡</td>";
            }else if(dataset1.getData(x,y) == 1) { 
                d += "<td>自动挡</td>";
            }else {
                d += "<td></td>";
            }
        }else if(x == 14){  
//          0-未收款 1-已收款
            if(dataset1.getData(x,y) == 0){
                d += "<td>未收款</td>";
            }else if(dataset1.getData(x,y) == 1) { 
                d += "<td>已收款</td>";
            }else {
                d += "<td></td>";
            }
        }else {
            d += "<td>" + dataset1.getData(x,y) + "</td>";       
        }
    }
    d += "</tr>";
}  

d = "<table>" + d + "</table>";    
tableToExcel(d, "后付费简版订单数据");
